import React from 'react';
import ReactDOM from 'react-dom';
// import Footer from './components/Footer.js'
import Footer from './components/footer.js';
// import '../node_modules/@coreui/coreui/dist/css/coreui.min.css'
import { Button } from "@mui/material"
// import 'https://unpkg.com/@coreui/coreui/dist/css/coreui.min.css';
import '@coreui/coreui/dist/css/coreui.min.css';
import Navbar from './components/navbar.js';




const App = () => {

  return <div>
    <Navbar />
    <div className="text-center pb-12 md:pb-16">
      <h1 className="text-5xl md:text-6xl font-extrabold leading-tighter tracking-tighter mb-4" data-aos="zoom-y-out">Jesus Celestino <span className="bg-clip-text text-transparent bg-gradient-to-r from-blue-500 to-teal-400">Aspiring Software Developer</span></h1>
      <div className="max-w-3xl mx-auto">
        <p className="text-xl text-gray-600 mb-8" data-aos="zoom-y-out" data-aos-delay="150">Recent graduate in computer science, passionate about launching my career as a software engineer. I am thrilled to showcase my skills, projects, and eagerness to contribute to a dynamic and innovative team.</p>
        <div className="max-w-xs mx-auto sm:max-w-none sm:flex sm:justify-center" data-aos="zoom-y-out" data-aos-delay="300">
        </div>
      </div>
    </div>

    <Button variant='text'> hello</Button>
    <Footer />
  </div>;

};

ReactDOM.render(<App />, document.getElementById('root'));
